import React from 'react';

const IconSVG = ({ d, title }) => (
  <svg className="tool-icon" viewBox="0 0 24 24" width="24" height="24" stroke="currentColor" strokeWidth="2" fill="none" strokeLinecap="round" strokeLinejoin="round">
    <title>{title}</title>
    <path d={d} />
  </svg>
);

const ToolBar = () => {
  return (
    <div className="tool-bar">
      <IconSVG d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" title="Search" />
      <IconSVG d="M10 13a5 5 0 007.54.54l3-3a5 5 0 00-7.07-7.07l-1.72 1.71" title="Link" />
      <IconSVG d="M19 7l-.867 12.142A2 2 0 0116.138 21H7.862a2 2 0 01-1.995-1.858L5 7m5 4v6m4-6v6m1-10V4a1 1 0 00-1-1h-4a1 1 0 00-1 1v3M4 7h16" title="Delete" />
      <IconSVG d="M4 21v-7a4 4 0 014-4h8a4 4 0 014 4v7" title="Expand" />
      <IconSVG d="M7 11V7a5 5 0 0110 0v4" title="Select" />
      <IconSVG d="M3 10h10a8 8 0 018 8v2M3 10l6 6m-6-6l6-6" title="Undo" />
      <IconSVG d="M21 10h-10a8 8 0 00-8 8v2M21 10l-6 6m6-6l-6-6" title="Redo" />
      <IconSVG d="M12 4v16m8-8H4" title="Zoom In" />
      <IconSVG d="M5 12h14" title="Zoom Out" />
      <IconSVG d="M21 10c0 7-9 13-9 13s-9-6-9-13a9 9 0 0118 0z" title="Pin" />
      <IconSVG d="M14 2H6a2 2 0 00-2 2v16a2 2 0 002 2h12a2 2 0 002-2V8z" title="Add File" />
    </div>
  );
};

export default ToolBar;
